import React,{Component} from 'react';  
import OwlCarousel from 'react-owl-carousel';  
import 'owl.carousel/dist/assets/owl.carousel.css';  
import 'owl.carousel/dist/assets/owl.theme.default.css';  
import './owl.css';  
export class Owldemo1 extends Component {  
        render()  
        {  
          return (  
            <div>  
          <div class='container-fluid' >      
           <div className="row title" style={{marginBottom: "20px"}} >      
             
           </div>  
       </div>  
       <div class='container-fluid' >            
        <OwlCarousel items={1}  
          className="owl-theme"  
          loop  
          nav  
          margin={8} >  
           <div className='final'><video controls className="img" src= {'assets/img/nba 60sec.mp4'}/></div>  
           <div><video  controls className="img" src= {'assets/img/nba 60sec.mp4'}/></div>  
           <div ><video controls className="img" src= {'assets/img/nba 60sec.mp4'}/></div>  
           <div><video controls  className="img" src= {'assets/img/nba 60sec.mp4'}/></div>  
           {/* <div ><video controls className="img" src= {'assets/img/nba 30sec.mp4'}/></div>   */}
           <div><video  controls className="img" src= {'assets/img/eversmile.mp4'}/></div>  
      </OwlCarousel>  
      </div>  
  
      </div>  
          )  
        }  
      }  
        
  
export default Owldemo1
